import "./Token.sol";
pragma solidity 0.8.6;


contract TokenCreator is Ownable {
    event TokenCreated(bool enabled);

    /*
    function createNewToken(address tokenOwner,
        string memory tokenName,
        string memory tokenSymbol,
        uint8 decimal,
        uint256 amountOfTokenWei,
        uint8 TxFeePercentToHolders,
        uint8 TxFeePercentToLP,
        uint8 TxFeePercentToBurned,
        uint8 TxFeePercentToWallet,
        uint8 TxFeePercentToBuybackTokens,
        uint8 MaxWalletPercent,
        uint8 MaxTxPercent,
        address payable _feeWallet) public payable {


            */

    /*
    addreses[0] tokenOwner
    addreses[1]_feeWallet

    -- params
    MaxTxPercent
    MaxWalletPercent
    TxFeePercentToHolders
    TxFeePercentToLP
    TxFeePercentToBurned
    TxFeePercentToWallet
    TxFeePercentToBuybackTokens
    */

    function createNewToken(
        address[] memory addreses,
        string memory tokenName,
        string memory tokenSymbol,
        uint256 amountOfTokenWei,
        uint8 decimal,
        uint8[] memory params
    ) public payable {


        //require(msg.value == 200000000000000000, "createNewToken: send value must be equal 0.2 ETH.");


        Token newToken = new Token(addreses[0], tokenName, tokenSymbol, decimal, amountOfTokenWei, params[0], params[1], payable(addreses[1]));
        newToken.setAllFeePercent(params[2],params[3],params[4],params[5],params[6]);

        emit TokenCreated(true);
    }

    function withdraw(uint256 amount) public onlyOwner {
        payable(owner()).transfer(amount);
    }

    function withdrawAll() public onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    fallback() external payable {
        // custom function code
    }

    receive() external payable {
        // custom function code
    }
}
